import React from 'react'

class App extends React.Component {

  state = {
    nome : 'alefe',
    sobrenome : 'patrick'
  }
  render(){
    return(
      <div>
          <h3>{this.state.nome}</h3><h2>{this.state.sobrenome}</h2>
      </div>
    )
  }
}

export default App;
